        <div className="controls">
        <div className="row">
            <div className="col-md-6">
                <div class="form-group">
                    <h1>Hello</h1>
                </div>
            </div>
            <div className="container">
                <h2>LA</h2>
            </div>
        </div>
    </div>

    );
}

export default Contact;
